### Find patterns forming clumps in a string ###
from BA1K import FrequencyTable

def FindClumps(text,k,l,t):
    patterns = set()
    n = len(text)

    for i in range(n-l+1):
        window = text[i:i+l]
        freqMap = FrequencyTable(window,k)

        for s in freqMap:
            if freqMap[s] >= t:
                patterns.add(s)
    return patterns

text = ''
k = 11
L = 515
t = 16
# print(FindClumps(text,k,L,t))

clumps = FindClumps(text,k,L,t)
answer = ''
for clump in clumps:
    answer += clump + ' '
answer = answer[:-1]
print(answer)